import logo from './logo.svg';
import './App.css';

import { useState } from 'react';

function Square() {

  const [value, setValue] = useState(null);

  function handleClick() {
    setValue('X');
  }

  return (
    <button className="square" onClick={handleClick}> {value}
    </button>
  );
}

export default function App() {
  return (
    <>
      <head>
      <title>Acasă</title>
      </head>
      <body>

        <main>
        <div>

        <p><b>Pagina Despre conține:</b></p>
            <ol>
                <li>Câteva informații despre cele 7 Minuni ale lumii</li>
                <li>Un link către o pagină ce oferă informații legate de acest subiect</li>
                <li>Un formular de abonare la newsletter</li>
            </ol> 

        </div>
        </main>

      </body>

      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}
